import { CRow } from "@coreui/react";
import { Form } from "react-bootstrap";
import CButton from "src/Components/UI/Button/Button";
import FormInputLabel from "src/Components/UI/Input/FormInputLabel";
import FormSelect from "src/Components/UI/Input/FormSelect";
const Store = () => {
  return (
    <>
      <Form>
        <CRow>
          <FormInputLabel
            md={6}
            sm={12}
            label="Product Name"
            type="text"
            readOnly={false}
          />
        </CRow>
        <CRow>
          <FormInputLabel
            md={6}
            sm={12}
            label="Price"
            type="text"
            readOnly={false}
            placeHolder="$ 0.00"
          />
        </CRow>
        <CRow>
          <FormInputLabel
            md={6}
            sm={12}
            label="Product Image"
            type="file"
            readOnly={false}
          />
        </CRow>
        <CRow>
          <FormSelect
            md={6}
            sm={12}
            label="Product Status"
            options={["draft", "active"]}
          />
        </CRow>
        <CRow>
          <FormInputLabel
            md={6}
            sm={12}
            label="Quantity"
            type="number"
            readOnly={false}
            placeHolder="1"
          />
        </CRow>
        <CRow>
          <CButton color="success" width="30%" type="submit" />
        </CRow>
      </Form>
    </>
  );
};
export default Store;
